import React from 'react';
import './pcty-accumulator.css';

const PctyAccumulator = ({id, percentage}) => {
    //#249661;
    const renderAccumulator = function () {
        let accumulator = document.getElementById(id);
        let ctx = accumulator.getContext("2d");
    }

    return (
        <canvas id={id} className="Pcty-accumulator" onLoad={renderAccumulator()}/>
    );
}

export default PctyAccumulator;
